    prime = True
    for i in range(1, n+1):
        if i % 2 == 0:
            prime = False
            break
        if prime:
            prime = i % 2 == 0
    # check if the number is prime
    if prime:
        prime = True
        for i in range(2, n+1):
            if i * i <= n:
                prime = False
                break
        if prime:
            prime = True
            for i in range(2, n+1):
                if i * i <= n:
                    prime = False
                    break
        return prime
    return False

